import React from 'react'

function Title({level, content, classN}) {
  return (
    level === 1 ?<h1 className={classN}>{content}</h1>
    : level === 2 ?<h2 className={classN}>{content}</h2>
    : level === 3 ?<h3 className={classN}>{content}</h3>
    : level === 4 ?<h4 className={classN}>{content}</h4>
    : level === 5 ?<h5 className={classN}>{content}</h5>
    : <h6>{content}</h6>
  )
}

export default Title
